import React from 'react';
import { Layout, Menu } from 'antd';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './Home';
import Login from './Login';
import PropertyInputPage from './PropertyInputPage';
import PropertyList from './PropertyList';
import PropertyDetail from './PropertyDetail';
import Favorites from './Favorites';
import ContactForm from './ContactForm'; // Assuming you have a separate contact form component

const { Header, Content, Footer } = Layout;

const HomePage = () => {
  return (
    <Router>
      <Layout className="layout">
        <Header style={{ backgroundColor: 'rgba(0, 0, 0, 0.8)', position: 'fixed', width: '100%', zIndex: 1 }}>
          <div className="logo" style={{ float: 'left', color: 'white', fontSize: '24px' }}>
            <Link to="/" style={{ color: 'white' }}>Dream Home Finder</Link>
          </div>
          <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['1']} style={{ backgroundColor: 'transparent', display: 'flex', justifyContent: 'flex-end' }}>
            <Menu.Item key="1">
              <Link to="/" style={{ color: 'white' }}>Ana Sayfa</Link>
            </Menu.Item>
            <Menu.Item key="2">
              <Link to="/property-list" style={{ color: 'white' }}>Emlak Listesi</Link>
            </Menu.Item>
            <Menu.Item key="3">
              <Link to="/login" style={{ color: 'white' }}>Giriş Yap</Link>
            </Menu.Item>
            <Menu.Item key="4">
              <Link to="/contact" style={{ color: 'white' }}>İletişim</Link>
            </Menu.Item>
          </Menu>
        </Header>
        <Content style={{ paddingTop: '64px', minHeight: '100vh' }}>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/property-input" element={<PropertyInputPage />} />
            <Route path="/property-list" element={<PropertyList />} />
            <Route path="/property-detail/:id" element={<PropertyDetail />} />
            <Route path="/favorites" element={<Favorites />} />
            <Route path="/contact" element={<ContactForm />} />
          </Routes>
        </Content>
        <Footer style={{ textAlign: 'center', backgroundColor: 'rgba(0, 0, 0, 0.5)', color: 'white' }}>
          Emlakçı Otomasyonu ©2024 Created by You
        </Footer>
      </Layout>
    </Router>
  );
};

export default HomePage;
